import React from 'react';

import Card from './Cards';
import Sdata from './Sdata'
import Images from './Images'
 const App=()=>(
  <>
     <h1 className="heading_style">list of netflix series</h1>
     {Sdata.map((val)=>{
         return(
            <Card 
    imgsrc={val.img}
    title={val.title}
    sname={val.sname}
/>
         )
     })}


</> 
 )
export default App
